import fetch from 'isomorphic-unfetch'

function Page({ stars }) {
  return <div>Next stars: {name}</div>
}

Page.getInitialProps = async ctx => {
  const res = await fetch('https://api.github.com/users/marcusfooo/repos')
  const json = await res.json()
  return { 
    name: json.name
  }
}

export default Page
